INNER JOIN uc04_data.results ON uc04_data.account_details.Account_ID=uc04_data.results.Account_Sender
WHERE uc04_data.account_details.Account_ID IN ($Filter_Sender) AND uc04_data.results.Account_Receiver IN ($Filter_Receiver);

